      return <p key = {index}>{elem}</p>
  })
  const copy = Object.assign([], notes);
  copy[1] = "!"



  return <div>
      <button onClick = {() => getNotes(copy)}>писька</button>
      <p>{notes}</p>
      {map}
  </div>
}
